import logo from "./logo.svg";
import "./App.css";
import Form from "./components/Form";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="w-screen h-screen ">
      <div className="items-center justify-center max-w-7xl mx-auto">
        <Navbar />
        <Form />
      </div>
    </div>
  );
}

export default App;
